function Exercise5(){
   return( 
<>  
<head>
<meta name="viewport" content="width=device-width, initial-scale=1.0"></meta>
</head>
<div class='body'>
{/* flex */}
<div class="c1">
        {/* heading */}
       <div class='d1'style={{textAlign:'center'}}>
        <strong>Current Status: </strong>
          Started...
        </div>

        {/* subheading */}
        <div class="grid-container">
        <div class="grid-item" style={{ color: 'white'}}><button>STOP</button></div>
        <div class="grid-item" style={{ color: 'white'}}><button>RESET</button></div>
        <div class="grid-item"><label style={{fontSize:'10px'}}>Speed</label></div>
        </div>

        {/* subheading */}
        <h1 style={{textAlign:'center'}}>Events</h1>

        {/* displaying event details */}
    <div class="outerEventBox">
    <div class="innerEventBox">
    <MDBContainer>
        <MDBRow>
            <MDBCol size="2" style={{color:'black'}}>Stocks</MDBCol>
            <MDBCol size="2">hs</MDBCol>
            <MDBCol size="2">ss</MDBCol>
        </MDBRow>
    </MDBContainer>
    </div>
    </div>

</div>
</div>
    </>
   )
}

export default Exercise5;
